import react from 'react';
import web from "../src/images/programming-background-collage_23-2149901789.avif"
import { NavLink } from 'react-router-dom';
import Common from "./Common";
const Home=()=>{
    return(
        <>
           <Common name="Capturing Moments, Creating Memories: Your Story, Our Lens"
            imgsrc={web}
            visit="/service"
            btname="Get started"
           />
        </>
    );
};
export default Home;
